            * {
                padding: 0;
                margin: 0;
            }
            html {
                box-sizing: border-box;
            }

            body {
                height: 100%;
            }
            #wrapper {
                width: 85%;
                height: auto;
            }
            #header {
                width: 100%;
                height: 75px;
                padding: 50px 0 0 75px;
                margin: 0 auto;
            }
            #header h1 {
                font:
                    900 3.5em "Raleway",
                    Arial,
                    sans-serif;
                display: inline-block;
            }
            #header svg {
                position: relative;
                left: 18px;
            }

            #registration-container {
                width: 100%;
                height: 300px;
            }

            #registration div {
                width: 50%;
                background: rgb(229, 299, 158);
                margin: 25px auto;
            }
            #registration h1 {
                font:
                    900 1.5em phosphate,
                    Arial,
                    sans-serif;
                margin-bottom: 15px;
            }
            #registration h2 {
                font:
                    300 1.5em phosphate,
                    Arial,
                    sans-serif;
                color: #de1a8b;
                padding: 10px 0px;
                letter-spacing: 4px;
            }
            #registration {
                margin: 75px auto 0 auto;
                width: 500px;
                height: 250px;
                padding: 35px 0 0 0;
                background: #fafafa;
                text-align: center;
                border-radius: 15px;
                box-shadow: 2px 2px 3pc rgba(0, 0, 0, 0.3);
                z-index: 99999 !important;
            }
            #registration p:last-child {
                text-decoration: underline;
            }

            #footer {
                position: absolute;
                bottom: -20px;
                width: 100%;
                z-index: -9999 !important;
            }

            #music-symbols {
                position: absolute;
                bottom: 220px;
                left: 95px;
                z-index: -9999 !important;
            }
        </style>
    </head>
